import React from 'react'
interface MoviesPro {
    name: string;
    imgUrl: string;
    showDate: string;
    rating: number;
    isAvailable: boolean;
  }

  const movie :MoviesPro[]=[
    {
        name:'The Godfather',
        imgUrl:'data:image/jpeg;base64,',
        showDate:'02/10/1979',
        rating:9,
        isAvailable:true
    },
    {
        name:'The Dark Knight',
        imgUrl:'data:image/jpeg;base64,',
        showDate:'02/5/2008',
        rating:9,
        isAvailable:true
    },
    {
        name:'Inception',
        imgUrl:'data:image/jpeg;base64,',
        showDate:'02/10/2010',
        rating:8,
        isAvailable:true
    },
    {
        name:'The Lion King',
        imgUrl:'data:image/jpeg;base64,',
        showDate:'02/10/1994',
        rating:8.7,
        isAvailable:true
    },
    {
        name:'Back to the Future',
        imgUrl:'data:image/jpeg;base64,',
        showDate:'02/10/1994',
        rating:8.5,
        isAvailable:false
    }
    


  ]

function Movies() {
  return (
    <>
    {movie.map((movie, i) => {
      let soonMsg: string = '';
      if (!movie.isAvailable) {
        soonMsg = 'Soory will be available soon';
      }
      return (
        <div key={i} className="card">
          <img className="card-img" src={movie.imgUrl} alt="" />
          <h2>{movie.name}</h2>
          <p id='p'>{movie.showDate}</p>
          <p>{movie.rating}⭐</p>
          <p>{movie.isAvailable}</p>
          {soonMsg.length > 0 ? <p>{soonMsg}</p> : <span></span>}
        </div>
      );
    })}
  </>
  )
}

export default Movies